import React from "react";

const Steps1 = ({steps, para, step }) => {
  return (
    <>
      <div className="step-box">
        <div className="row">
          <div className="index">
            <p>{}</p>
          </div>
          <div className="steps">
            <p>Step 1 </p>
            <p>Your Info</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Steps1;
